スタイリッシュなデザインのセキュリティ。パープルLEDが待機時残光点滅、衝撃感知時激しく点滅。走行中の連続振動感知で自動停止(特許登録済)。光センサー内蔵で暗くなると自動点滅開始。
<br><br>
品名 NIGHT-SIGNAL SMART PU<br>
カラー パープル(PURPLE)<br>
製品重量 25g<br>
製品サイズ H13×W103×D28(mm)<br>
パッケージ重量 65g<br>
パッケージサイズ H180×W85×D25(mm)<br>
