【スイッチパネル(ホールカバー)交換方法】<br>
１．スイッチパネルが付いているパネルを外し、裏側が見えるようにします
(車種により方法は変わります)<br>
２．交換したいパネルの上下にある爪を押し込み、表側に押すと外れます。<br>
３．本製品、スイッチ本体をパネルの穴に同じように取り付けます。<br>
４．配線を接続したらコネクタをスイッチ本体に挿入します。<br><style type="text/css">
